import Head from 'next/head';

const Index = ()=>(
    <div>
    <Head>
    <title>LiveIzy</title>
    </Head>
    <header>This My Header</header>
    <main>
    <h1>Welcome To My Page</h1>
    </main>
    <footer>This is  my footer</footer>
    </div>
);
export default Index;
